import { Link } from 'react-router-dom';
const AppointmentItem = ({ appointment }) => {
  return (
    <div className='appointment-item'>
      <div className='appointment-item-header'>
        <h3>Appointment #{appointment.id}</h3>
        <p>{appointment.date}</p>
      </div>
      <div className='appointment-item-body'>
        <div className='appointment-item-body-left'>
          <p>Time: {appointment.time}</p>
          <p>Technician: {appointment.technician}</p>
          <p>Type: {appointment.type}</p>
          <p>Status: {appointment.status ? 'Active' : 'Inactive'}</p>
        </div>
        <div className='appointment-item-body-right'>
          <p>Price: {appointment.price}</p>
          <Link to={`/appointments/${appointment.id}`}>
            <button>View</button>
          </Link>
        </div>
      </div>
    </div>
  );
};
export default AppointmentItem;
